import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div style={{fontSize:'20px'}}>
        <label>
          <input type='radio' name='compo' defaultValue='1' defaultChecked/>OneApp
        </label>&nbsp;
        <label>
          <input type='radio' name='compo' defaultValue='2'/>TwoApp
        </label>&nbsp;
      </div>
    </div>
  );
}

export default App;
